import { useTranslation } from "react-i18next";
const { t } = useTranslation();
export const Prices = [
  {
    _id: 0,
    name: {},
    array: [0, 19],
  },
  {
    _id: 1,
    name: "$20 to 39",
    array: [20, 39],
  },
  {
    _id: 2,
    name: "$40 to 59",
    array: [40, 59],
  },
  {
    _id: 3,
    name: "$60 to 79",
    array: [60, 79],
  },
  {
    _id: 4,
    name: "$80 to 99",
    array: [80, 99],
  },
  {
    _id: 4,
    name: "$100 or more",
    array: [100, 9999],
  },
];
